    <button onclick="downloadAllImages()">Download All Images</button>
    <script>
        function downloadAllImages() {
            let count = 1
            while (true) {
                let elementImg = document.getElementById(`img${count}`)
                if (!elementImg) { break }
                let elementA = document.createElement('a')
                elementA.setAttribute('href', elementImg.getAttribute('src'))
                elementA.setAttribute('download', elementImg.getAttribute('id'))
                elementA.click()
                count++
            }
        }
    </script>
